class Solution:
    '''
        n = len(boxes)
        boxes[i] = one box
        boxes[i] = 0 -> 'empty' 
        boxes[i] = 1 -> 'contains ball' 
        
        boxes[i+1] = j 
        operation_1 = if abs(i-j) == 1:
                        -> move 1 ball from boxes[i] -> boxes[i+1]

        *NOTE: there CAN more than one ball in one box at the time, boxes[i] > 1 
        output: answer[] 
        len(answer) == len(boxes) = n 
        answers[i] = min operations for : "move all the balls to the i'th box"
    

        explaination:
            goal: move all balls to boxes[i],
                  in the min amonut of steps.
    '''
    def minOperations(self, boxes: str) -> list[int]:
        '''
            1.0) simple - double while loop, new list
        '''
        answer = []
        ith = 0
        n = len(boxes)
        print()
        op = 0 
        while ith < n:
            print(f"___ith={ith}_______________")
            i=0
            while i < n:
                print(f"    box nr.:{i}")
                if int(boxes[i]): #check if 1
                    print("     True: box=1")
                    print("          can move")
                    print(f"         num op: {i - ith} to move ball from i:{i} -> ith:{ith}")
                    op += abs(i-ith)
                else:
                    print("      False: box=0")
                print()
                i+=1
            answer.append(op)
            op=0
            ith+=1
        return answer
                
    def minOperations(self, boxes: str) -> list[int]:
        '''
            1.0) simple - double while loop, new list
            # NOTE: good memory usage, very poor runtime 6081ms
        '''
        answer = []
        ith = 0
        n = len(boxes)
        op = 0 
        while ith < n:
            i = 0
            while i < n:
                if int(boxes[i]): #check if 1
                    op += abs(i-ith)
                i+=1
            answer.append(op)
            op=0
            ith+=1
        return answer

    def minOperations(self, boxes: str) -> list[int]:
        '''
            2.0) simple - use operator and list comprehension
            402ms [full: - 1029ms] 
        '''
        answer = []
        ith = 0
        n = len(boxes)
        box_placements = [i for i, _ in enumerate(boxes) if int(boxes[i])] #indecies for balls
        while ith < n:
            answer.append(sum(abs(ith - i) for i in box_placements))
            ith+=1
        return answer

    def minOperations(self, boxes: str) -> list[int]:
        '''
            2.1) simple - use lambda 
            542ms [full: -] 
        '''
        answer = []
        ith = 0
        n = len(boxes)
        box_placements = [i for i, _ in enumerate(boxes) if int(boxes[i])] #indecies for balls
        while ith < n:
            answer.append(sum(map(lambda i: abs(ith - i), box_placements)))
            ith+=1
        return answer
    
    def minOperations(self, boxes: str) -> list[int]:
        '''
            2.1) simple - not list comprehension
            371ms [full: -] 
        '''
        answer = []
        ith = 0
        n = len(boxes)
        box_placements = [i for i, _ in enumerate(boxes) if int(boxes[i])] #indecies for balls
        while ith < n:
            ops = 0
            for i in box_placements:
                ops += abs(ith - i)
            answer.append(ops)
            ith+=1
        return answer
    









    
    
